// Leaderboard.js
import React, { useState, useMemo } from 'react';

const Leaderboard = ({ data, selectedModels, setSelectedModels, onSave }) => {

  const [sortConfig, setSortConfig] = useState({ key: null, direction: 'asc' });
  console.log(data);
  const handleModelSelect = (modelId) => {
    if (selectedModels.includes(modelId)) {
      setSelectedModels(selectedModels.filter((id) => id !== modelId));
    } else {
      setSelectedModels([...selectedModels, modelId]);
    }
  };

  const handleSort = (key) => {
    let direction = 'asc';
    if (sortConfig.key === key && sortConfig.direction === 'asc') {
      direction = 'desc';
    }
    setSortConfig({ key, direction });
  };

  const sortedData = React.useMemo(() => {
    const dataCopy = [...data];
    if (sortConfig.key !== null) {
      dataCopy.sort((a, b) => {
        if (a[sortConfig.key] < b[sortConfig.key]) {
          return sortConfig.direction === 'asc' ? -1 : 1;
        }
        if (a[sortConfig.key] > b[sortConfig.key]) {
          return sortConfig.direction === 'asc' ? 1 : -1;
        }
        return 0;
      });
    }
    return dataCopy;
  }, [data, sortConfig]);
  return (
    <div>
      <table>
        {/* Render table header */}
        <thead>
          <tr>
            <th>Select</th>
            <th onClick={() => handleSort('model_id')}>Model ID</th>
            <th onClick={() => handleSort('mean_residual_deviance')}>Mean Residual Deviance</th>
            <th onClick={() => handleSort('rmse')}>RMSE</th>
            <th onClick={() => handleSort('mse')}>MSE</th>
            <th onClick={() => handleSort('mae')}>MAE</th>
            <th onClick={() => handleSort('rmsle')}>RMSLE</th>
          </tr>
        </thead>
        <tbody>
          {Array.isArray(sortedData) &&
            sortedData.map((model, index) => (
              console.log(model),
              <tr key={model.model_id}>
                <td>
                  <input
                    type="checkbox"
                    checked={selectedModels.includes(model.model_id)}
                    onChange={() => handleModelSelect(model.model_id)}
                  />
                </td>
                <td>{model.model_id}</td>
                <td>{model.mean_residual_deviance}</td>
                <td>{model.rmse}</td>
                <td>{model.mse}</td>
                <td>{model.mae}</td>
                <td>{model.rmsle}</td>
              </tr>
            ))}
        </tbody>
      </table>
      <button onClick={onSave}>Save Selected Models</button>
    </div>
  );
};

export default Leaderboard;
